const Vcard = () => {
    const [items,setItems] =useState[
        {
        id:1,
        image: 'Icons_1',
        num:'$99,125.00',
        text:'Todays Revenue'
        },
        {
        id:2,
        image:'Icons_2',
        num:'365',
        text:'Transactions'
        }]
  return(
  <div>
    {items.map((item)=>{
        {console.log(item)}
        return(
            <div key={item.id}>{item.num}
            </div>
            
        )
        
    })}
    </div>
  )
}

export default Vcard
